import {router} from "../Utils/router";
import Index from "../Pages/HomePage/Index"
import IndexAbout from "../Pages/AboutPage/Index"

export const RoutesData = {
    mains : [
        {
            url: router.home,
            component: Index,
            layout: "home",
            title: ""
        },
        {
            url: router.about,
            component: IndexAbout,
            layout: "about",
            title: "О НАС"
        },
        {
            url: router.about,
            component: IndexAbout,
            layout: "about",
            title: "О НАС"
        },
        {
            url: router.about,
            component: IndexAbout,
            layout: "about",
            title: "О НАС"
        },
    ]
}
